Tsukihime Plus-Disc
Company: Type-Moon
Release date: Feb 01, 2001
Rating: All Ages
Language: English subtitled
Genre: visual novel

Summary: This is a fan disc of Tsukihime containing one short visual novel story, two omake stories and other fan materials. Akira Seo, an underclassman of Tsukihime's Akiha Tohno, becomes acquainted with someone calling themselves Shiki Tohno, and together they set out to solve the mystery of a recent series of murders.


Translation: Mirrormoon


